const fs = require("fs");

// Function to convert base64 to image (JPG or PNG)
function base64ToImage(base64String, outputFilePath) {
  // Remove the data URL prefix (optional, depending on your Base64 string)
  const base64Data = base64String.replace(/^data:image\/\w+;base64,/, "");

  // Convert the Base64 string back to binary data
  const buffer = Buffer.from(base64Data, "base64");

  // Write the binary data to a file (JPG or PNG)
  fs.writeFile(outputFilePath, buffer, (err) => {
    if (err) {
      console.error("Error writing file:", err);
    } else {
      console.log("Image saved successfully:", outputFilePath);
    }
  });
}

const test =
  "      Image (Base64): ";

const outputFilePath = "output_image.png"; // Output path (can be .jpg or .png)

// Convert and save the image
base64ToImage(test, outputFilePath);
